7D20BA";}i:73;a:1:{s:4:"type";s:5:"image";}i:74;a:1:{s:8:"owner_id";i:4290051421;}i:75;a:1:{s:14:"owner_username";s:0:"";}i:76;a:1:{s:14:"owner_fullname";s:0:"";}i:77;a:1:{s:9:"owner_pic";s:0:"";}i:78;a:1:{s:2:"id";s:19:"2391187078182118950";}i:79;a:1:{s:10:"short_code";s:11:"CEvM_qCjKYm";}i:80;a:1:{s:12:"created_time";i:1599271734;}i:81;a:1:{s:7:"caption";s:1341:"I’m done ✅ I had some interesting experiences today. I was originally scheduled to be in Atlanta today and had to reschedule at the last minute. I began my day with crying on a canyon. I laugh at myself now. I do not like driving on our narrow one lane two way roads without fencing on steep hills. The view is amazing, but I am not a fan.  I’ve experienced being in a car that found its way into a ditch while being suspended upside down. I’m not interested in that feeling again. So I bring this up to speak on limitations. Oftentimes there is a challenging gap in understanding for people to comprehend an experience or thought process of someone that has not lived it. For example, if your circle is filled with people that are content with poverty and you are grinding for a new level of financial security they may try to put you in their past experiences. If they don’t know what it’s like to pay a mortgage of $3,000 a month they may snub you, remind you of that time the roaches were your nightly guests, or try to say your household dynamics don’t match their impression of you. There is a difference in being poor minded and poor physically. I’m done with my work week, but I’m praying this little chat we just had worked to help you understand the impact of experiences. #dms #mindset #when #you #know #a #thing";}i:82;a:1:{s:14:"comments_count";i:0;}i:83;a:1:{s:11:"likes_count";i:1;}i:84;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvM_qCjKYm";}i:85;a:1:{s:5:"image";s:250:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118772745_1006820629795260_5519986757273122907_n.jpg?_nc_ht=scontent